import "./App.css";
import "./batman.jpg";

function App() {
  return (
    <div className="app1">
      <h1>Welcome to Login Page</h1>
      {/* <Router>
        <Route path="/signin" component={SignIn} />
      </Router> */}

<Router>
            <Switch>
              <Route path="/signin" component={SignIn} />
            </Switch>
          </Router>

      <Signup />
    </div>
  );
}

export default App;
